import styled from 'styled-components';

export const HeaderBlock = styled.div`
  width: 100%;
  height: 100px;
  background-color: skyblue;
`;

export const HeaderSection = styled.div`
  width: 100%;
  height: 50px;
`;
export const HeaderSectionText = styled.span`
  font-size: 1.3em;
`;
